Behind the painting: 
‚ÄúIt is a reflection of pop culture worship and idolization, as well as an affliction that finds itself intertwined with religion and understanding. What I mean is that to me, our eyes shift and worship things that are not what they seem. These things become a martyr and a yes man. If they do not do what we want, when we want them to, we kill them. This is why the character finds his throat slashed and dawning a halo. He has become something much larger, putting him at the center or worship. But as a consequence, he has no Choice in what he is. We kill him and move on to something else. In the end, we are distracted and violent. That is the meaning of Kill the Idol‚Äú. 
